import React from 'react';
import {FirstName} from './App'
const Compc=()=>{
    return(
        <>
        <FirstName.Consumer>
            {(fname)=>{
              return <h1>My Name Is {fname}</h1>
            }
            }
        </FirstName.Consumer>
        </>
    )
}
export default Compc;
